import React from 'react';
import { Container, Row, Col, Card, Spinner } from 'react-bootstrap';
import './Rolled.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Rolled = ({text, rolling}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={9} lg={6}>
          <Card className="mt-4 pt-2 pb-1 rollCard">
            {rolling ?
              <Spinner animation="border" className="justify-content-center"></Spinner> :
              // <h5 className="rollingIcon"><FontAwesomeIcon icon="skull" /></h5> :
              <h5>{text}</h5>
            }
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
